import {
  DivInputUpload,
  DivInputUploadTitle,
  DivInputUploadFile,
  CardUpload,
} from "./styles";

const InputUpload = () => (
  <>
    <DivInputUpload>
      <DivInputUploadTitle>
        <h2 className="title">Bulk Upload form </h2>
        <div className="text-help">
          <span>you haven't upload any bulk data yed</span>
        </div>
      </DivInputUploadTitle>
      <hr />
      <DivInputUploadFile>
        <h2 className="title">Choose your an input medthod</h2>
      </DivInputUploadFile>
    </DivInputUpload>
  </>
);

export default InputUpload;
